import React from 'react';
import '../App.css';
import './info.css';
import './Cards.css';


function Info() {
  return (
    <section className='info-container'>
        <div className ='info-past-events'>
        <h1>Upcoming Events</h1>
        <ul>
       
            <li className = 'info-event'>Event 1</li>
            <li className = 'info-event'>Event 2</li>
            <li className = 'info-event'>Event 3</li>
      

        </ul>
       

      </div>
      <article classname='info-box'>
        
      <h5>Previous Events</h5>
      <ul>
       
       <li className = 'info-event'>Event 1</li>
       <li className = 'info-event'>Event 2</li>
       <li className = 'info-event'>Event 3</li>
 

   </ul>

      </article>
    
    

      
            </section>
  );
}

export default Info;
